import React from 'react';
import { Container, Typography, Grid, Box, Card, CardContent } from '@mui/material';
import { motion } from 'framer-motion';
import SchoolIcon from '@mui/icons-material/School';
import GroupIcon from '@mui/icons-material/Group';
import EmojiEventsIcon from '@mui/icons-material/EmojiEvents';
import { styled } from '@mui/material/styles';

const StyledIcon = styled(Box)(({ theme }) => ({
  fontSize: '3rem',
  color: theme.palette.primary.main,
  marginBottom: theme.spacing(2),
}));

const About = () => {
  const stats = [
    { icon: <SchoolIcon fontSize="inherit" />, number: '50+', label: 'Programs' },
    { icon: <GroupIcon fontSize="inherit" />, number: '10,000+', label: 'Students' },
    { icon: <EmojiEventsIcon fontSize="inherit" />, number: '95%', label: 'Success Rate' },
  ];

  return (
    <Box sx={{ py: 8 }}>
      <Container>
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Typography variant="h2" gutterBottom align="center">
            About Our College
          </Typography>
          <Typography variant="h5" paragraph align="center" color="text.secondary">
            Building Tomorrow's Leaders Today
          </Typography>
        </motion.div>

        <Grid container spacing={4} sx={{ mt: 4 }}>
          <Grid item xs={12} md={6}>
            <Typography variant="body1" paragraph>
              Founded in 1990, our college has been at the forefront of educational
              excellence for over three decades. We are committed to providing
              quality education that prepares students for successful careers and
              meaningful lives.
            </Typography>
            <Typography variant="body1" paragraph>
              Our state-of-the-art facilities, experienced faculty, and innovative
              teaching methods create an environment where students can thrive and
              reach their full potential.
            </Typography>
          </Grid>
          <Grid item xs={12} md={6}>
            <Box
              component="img"
              src="/campus.jpg"
              alt="Campus"
              sx={{
                width: '100%',
                height: 'auto',
                borderRadius: 2,
                boxShadow: 3,
              }}
            />
          </Grid>
        </Grid>

        <Grid container spacing={4} sx={{ mt: 6 }}>
          {stats.map((stat, index) => (
            <Grid item xs={12} md={4} key={index}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.2 }}
              >
                <Card elevation={2}>
                  <CardContent sx={{ textAlign: 'center' }}>
                    <StyledIcon>{stat.icon}</StyledIcon>
                    <Typography variant="h3" gutterBottom>
                      {stat.number}
                    </Typography>
                    <Typography variant="h6" color="text.secondary">
                      {stat.label}
                    </Typography>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>

        <Box sx={{ mt: 8 }}>
          <Typography variant="h4" gutterBottom>
            Our Mission
          </Typography>
          <Typography variant="body1" paragraph>
            To empower students with knowledge, skills, and values that enable them
            to excel in their chosen fields and contribute positively to society.
            We strive to create an inclusive learning environment that fosters
            creativity, critical thinking, and innovation.
          </Typography>
        </Box>
      </Container>
    </Box>
  );
};

export default About;
